B.B4=new A.au("Offline mode","Data usage reduction","Version 2023.20.1 includes an updated offline mode that is configurable. You can disable sending Telemetry data to Tesla(important for FSD Beta users), and the firmware updates don't have to download using the Tesla Android Wi-Fi network.\n\nThe ability to check if your car runs the latest Tesla firmware is not affected.\n\nKudos to Green and Soma for making this possible!")
B.AX=new A.au("Full-Screen launcher","Usability improvements",'An early Full-Screen frontend is now available. You can access it using a new "Go Full-Screen" button in the Flutter App or by navigating to fullscreen.app.teslaandroid.com. \n\nThe Virtual Display still needs to fill the entire window, and there might be some minor UI issues in the Flutter App.')
B.B_=new A.au("Networking","Routing improvements","You can access your Tesla Android by typing using app.teslaandroid.com instead of typing the IP address.\n\nThe DHCP server is no longer using a public IP range. Tesla Android switched to a Carrier-grade NAT range.")
