B.AG=new A.au("Wi-Fi","Performance improvements","Version 2023.20.1 add support for 5GHz Wi-Fi. The new future can be manually enabled in Settings and should improve the network speed significantly.\n\nUsers with their own routers can now disable to Tesla Android Wi-Fi network altogether.")
B.AO=new A.au("Flutter App","Stability improvements","Version 2023.20.1 improves the Connectivity Check module. The app is also fully integrated with a self-hosted instance of Sentry(Performance monitoring & Error Tracking).\n\nThe data is anonymised and no fingerprints are captured. Crash logs contain the version of firmware and display resolution. ")
