B.AI=new A.au("Android Platform","Stability improvements","Android has been updated to Android 13 release 43 with the latest security patches.")
B.Bb=new A.au("Web server","Usability improvements","Cache settings are now less aggressive. You should not need to clear browser data after every Tesla Android update.")
