B.B5=new A.au("Android Platform","Stability improvements","Android has been updated to Android 13.0.0_r31 with the latest available security patches.")
B.Bf=new A.au("H264 hardware acceleration","Stability improvements","Version 2023.7.1 improves the stability of the playback and solves issues with artifacts present in the previous version.")
B.AT=new A.au("H265 hardware acceleration","Usability improvements","This version adds support for hardware-accelerated H265 video playback via ffmpeg_codec2.")
B.Bw=new A.au("Software audio decoders","Usability improvements","2023.7.1 adds software audio decoders exposed by ffmpeg_codec2 for the following file formats: \n\u2022 aac  \n\u2022 ac3  \n\u2022 alac  \n\u2022 flac  \n\u2022 mp2  \n\u2022 mp3  \n\u2022 vorbis  \n\nMost of the formats were previously supported by software decoders included with Android. The ffmpeg-powered replacements tend to consume fewer CPU resources.")
B.Bd=new A.au("Software video decoders","Usability improvements","2023.7.1 adds software video decoders exposed by ffmpeg_codec2 for the following file formats: \n\u2022 h263  \n\u2022 mpeg2  \n\u2022 mpeg4  \n\u2022 vp8  \n\u2022 vp9  \n\nMost of the formats were previously supported by software decoders included with Android. The ffmpeg-powered replacements tend to consume fewer CPU resources.")
B.Ay=new A.au("Flutter App","Stability improvements","Flutter App received various improvements in this update: \n\u2022 The framework has been updated to version 3.7. \n\u2022 Version ribbon has been repositioned to the upper right corner. \n\u2022 Reverted changes in touchscreen transport that were introduced in 2023.4.1. The previous implementation was more stable.\n\u2022 The reliability of the connectivity checker module was improved by removing the ability to cache static HTML content in Lighttpd. The browser used to cache the health check response for a while after Tesla Android services became unavailable.")
B.Bi=new A.au("Audio playback","Stability improvements","This version increases the audio playback buffer flush interval from 30 to 100 milliseconds with the hope of decreasing stuttering in cases where the MCU is not able to process the data from WebSocket transport in time.")
