B.Bj=new A.au("Virtual display","Performance improvements","Version 2023.4.1 introduced a new transport layer to the virtual display. Unfortunately, it misbehaved in vehicles with Intel MCU, especially those with the Wi-Fi antenna placed outside the car. This version brings back the transport from 2022.45 and keeps other improvements like the connectivity check module.")
B.Bc=new A.au("Audio playback","Usability improvements","The previous update introduced volume control in Android. However, default values were around 50%, confusing users. 2022.4.2 resolves this issue and sets the Android system volume to 100%.")
B.BC=new A.au("Flutter App","Performance improvements","Version 2023.4.2 brings several improvements in performance to the Flutter app: \n\u2022 Removed fade-in and fade-out transitions from the audio playback component on each buffer flush. This change makes the volume curve consistent.\n\u2022 After introducing a workaround for offline PWA support, the rendering engine was changed from HTML to CanvasKit.\n\u2022 Reduced the amount of ping/pong frames used by the WebSocket transport for the virtual touchscreen")
B.FS=A.a(s([B.Bj,B.Bc,B.BC]),t.c)
B.Ve=new A.fn("2023.4.2",B.FS)
B.B6=new A.au("Android 13","Stability improvements","The Android version has been updated to 13, and this change improves the stability of Tesla Android. Security patches have also been merged up to October 2022. The Android base for Raspberry Pi used by Tesla Android(Glodroid Project) has also been updated to the newest release, and it comes packed with improvements around the kernel, display drivers, and much more.\n\nThe entire Tesla Android codebase has been refactored in order to make feature Android Platform updates easier; this is an essential step towards making the project more maintainable.")
B.AY=new A.au("H264 hardware acceleration","Performance improvements","Version 2022.4.1 adds support for hardware accelerated encoder and decoder for the H264 format. Playback of specific files can contain a small number of artifacts. This is a known issue that will be addressed in the future Tesla Android update. The current implementation of hardware acceleration is based on v4l2_codec2 and will be replaced with an alternative that supports more video formats.")
B.B9=new A.au("Virtual display","Stability improvements","The virtual display has been updated to use WebSockets for transport.")
B.B0=new A.au("Virtual touchscreen","Stability improvements","This version contains a fix for a problem with not being able to process input data after reloading the Flutter App.")
B.B8=new A.au("Audio playback","Stability improvements","The Audio Capture app that used to provide audio from Android to the Browser has been replaced with a new low-level implementation that integrates directly with the Android framework responsible for generating the audio stream before it\u2019s broadcasted to the actual hardware(HDMI, headphone jack, etc.). This new approach brings in a lot of other improvements:\n\u2022 Increased audio quality (stereo PCM 48kHz - Lossless Audio)\n\u2022 Support for DRM content (streaming services)\n\u2022 Support for volume control in Android (available in the Android Settings app)")
B.BE=new A.au("Flutter app","Stability improvements","The Flutter App has been refactored to improve stability. Here are some of the changes:\n\u2022 WebSockets handling for Tesla Android services has been improved.\n\u2022 Thanks to the new transport layer, the Virtual Display component is now powered by Flutter. This significantly improves stability when compared to the previously used Iframe-based approach.\n\u2022 The connectivity state observer component has been introduced. The app will notify you when it wouldn\u2019t be able to access Tesla Android services. This change ensures you will not have to manually reload the app when your car returns from sleep or the hardware itself restarts.\n\u2022 Flutter Framework has been updated to version 3.3.10")
B.Ba=new A.au("USB tethering for iOS","Connectivity improvements","Version 2023.4.1 adds support for sharing the internet from iOS devices via USB. Connect your phone, enable tethering and accept the USB access permission request on your iPhone.")
B.Bs=new A.au("LTE Modem support","Connectivity improvements","This update introduces a new Android system service. The Tesla Android USB Networking Initializer simplifies how USB Modems are initialized and allows the use of per-device configuration scripts. This change resolved issues with some variants of Alcatel devices and added support for more Huawei modems.")
