B.Bl=new A.au("Single Board stack","Hardware and setup improvements","Tesla Android does not need the hardware HDMI capture interface anymore. Updated video layer also uses less resources.")
B.Az=new A.au("Single system image","Setup improvements","Starting with version 2022.44.1 there is a new way to install Tesla Android.\n\nNew single image setup process that does not need adb or fastboot. This change requires a 64GB(or larger) SD card.")
B.AE=new A.au("LTE","Fixes for Huawei E3372","Previous release broke support for Huawei E3372. This issue is now resolved.")
B.BH=new A.au("Android platform","Boot time improvements","Version 2022.44.1 includes multiple internal optimisations that allow for your Tesla Android to boot up faster after the car wakes from sleep.")
B.AS=new A.au("Virtual display","Performance and quality improvements","Virtual display resolution has been increased to enable high fidelity Android experience in your Tesla.\n\nThe responsiveness is also improved thanks to internal changes in the video layer.")
B.BF=new A.au("CarPlay","Performance improvements","Improvements in the video layer leave more performance for other components.\n\nDecoding video stream from CarPlay is faster in version 2022.44.1.")
B.Bg=new A.au("Flutter Frontend","Stability improvements","Flutter frameworks has been updated in order to improve user experience.")
B.HP=A.a(s([B.Bl,B.Az,B.AE,B.BH,B.AS,B.BF,B.Bg]),t.c)
B.Vf=new A.fn("2022.44.1",B.HP)
B.AV=new A.au("Single Board stack","Hardware and setup improvements","Tesla Android does not need two Raspberry Pi boards anymore!\n\nVersion 2022.38.1 is based only on Android.\n\nThis marks a significant milestone for the project and greatly lowers the barrier of entry both in terms of cost and ease of setup.")
B.Bk=new A.au("Browser Audio","Stability and volume improvements","Version 2022.38.1 brings fixes to the browser audio streaming module.\n\nThe output volume has been adjusted to match Bluetooth music playback when using CarPlay.\n\nAudio capture service on Android is now a persistent system service that doesn't need to request permissions and automatically restarts on failure.\n\nBandwidth consumption has been significantly reduced when the music is not playing.")
B.AU=new A.au("Offline Mode","Support for the Chinese market and bugfixes","Single board stack includes an updated version of the Offline mode introduced in version 2022.27.1. Connectivity is now handled directly within the Android system, Pi-hole is no longer required.\n\nThanks to the community input Tesla Android works better in China - version 2022.38.1 includes fixes for connection dropouts due to different API endpoints in this market.")
B.AZ=new A.au("Wi-Fi","Hotspot improvements","With Tesla Android Single Board you can now manage your Hotspot settings directly in your Tesla.\n\nUpdating your network name and credentials is now possible in the Android Settings app.")
B.Br=new A.au("Virtual display","Backend improvements and bugfixes","Starting with version 2022.38.1 Tesla Android does not use Ustreamer for video streaming.\n\nSingle board stack uses a modified version of mjpg_streamer built with Android NDK.\n\nThe new solution is modular and was chosen with bringing direct framebuffer capture to Tesla Android in mind.\n\nResolution of the virtual display has been updated to match the Tesla Browser viewport introduced with Tesla Version 2022.24.")
B.Bx=new A.au("Flutter Frontend","Stability improvements","Flutter Frontend has been updated in order to improve user experience.\n\nFramework version has been bumped to 3.3.")
B.Hf=A.a(s([B.AV,B.Bk,B.AU,B.AZ,B.Br,B.Bx]),t.c)
B.V8=new A.fn("2022.38.1",B.Hf)
B.B7=new A.au("Offline Mode","LTE modem is now optional","Starting with version 2022.27.1 the LTE modem is not required for Tesla Android to maintain connection with your car.\n\nKeep in mind that certain online features might not be available in your car as it expects the Wi-Fi network to replace the connectivity provided by Tesla.\n\nWhen using the Offline Mode turning off Wi-Fi on your touchscreen or powering off Tesla Android is required for accessing your car with the Tesla Mobile App while parked.\n\nTesla Android can still be used to provide internet to your car like in previous build - no extra configuration changes are required.")
B.BI=new A.au("Wi-Fi","Persistent connection with your Tesla","As a result of introducing the new Offline Mode Wi-Fi stability and connection times have been significantly improved.\n\nIf you use the (now optional) LTE modem to get a full Android experience your Wi-Fi with the car won't disconnect when there is no LTE coverage(highways, underground parking etc)")
B.AF=new A.au("Virtual display","Quality improvements","Video stream quality has been slightly improved after reducing the image compression.")
B.Be=new A.au("Flutter Frontend","Stability improvements","Flutter Frontend has been updated in order to improve user experience.\nFramework version has been bumped to 3.0.4. Rendering engine has been switched to HTML from CanvasKit due to problems with offline loading in Flutter.")
B.He=A.a(s([B.B7,B.BI,B.AF,B.Be]),t.c)
B.Vi=new A.fn("2022.27.1",B.He)
B.AC=new A.au("Virtual display","Performance improvements","Display component has been refactored in order to allow up to 60Hz refresh rate.\n\nTesla Android will now behave normally when loaded in Drive or Reverse.\n\nSimplification of video stack improves stability of the Flutter application running in the Tesla Browser.")
B.AA=new A.au("Audio Output","Combined audio streams","Audio from Android is routed directly to your Tesla Browser.\n\nPlayback is allowed even when Drive or Reverse is engaged, meaning that there is no need to pair Tesla Android with your car using Bluetooth(Bluetooth link with the car is only used by your phone for Android Auto or CarPlay).\n\nAudio output from Tesla Browser does not pause media playback from Tesla OS or CarPlay. \n\nIn order to active this feature open Audio Capture app on your Tesla Android after installing the OS. It will automatically launch on each boot later. Audio Capture can be terminated using a button present in the status notification.\n\nNot all apps support audio capture, this restriction will be removed in a feature update.")
B.BA=new A.au("Flutter Frontend","Stability improvements","Flutter Frontend has been updated in order to improve user experience.\n\nLoading times have been improved significantly.\n\nAll major components of the app now have proper state management and error handling.")
B.B2=new A.au("Android Platform","Move to Android 12.1","Tesla Android has been migrated to Android 12.1 from AOSP Master in order to improve stability.\nRelease 2022.25.1 includes Android security updates up to May 5, 2022.")
B.Bo=new A.au("Orientation lock","All apps launch in landscape","Tesla Android now includes a working orientation lock for third party apps.\n\nThis feature allows phone apps like Apple Music to launch in landscape.")
B.AJ=new A.au("Google Play Store","App discoverability","Google Play Store has been replaced with Aurora Store, an Open Source alternative that includes Device Spoofing(emulating Google certification).\n\nGoogle Play Services have been replaced with microG(Open Source Google Apps).\n\nFDroid(Open Source App Store that does not rely on Google Play Store) is also included.")
B.By=new A.au("Video Streaming","DRM support","Tesla Android now supports DRM video playback. Apps like Netflix function normally in version 2022.25.1")
